import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Header.css';

const Header = ({ user, onLogout }) => {
  const navigate = useNavigate();

  const handleHomeClick = () => {
    if (user) {
      navigate('/dashboard'); // Redirect to dashboard if logged in
    } else {
      navigate('/'); // Redirect to home if not logged in
    }
  };

  const handleEmployeeListClick = () => {
    if (user) {
      navigate('/employee-list'); // Redirect to employee list if logged in
    }
  };

  const handleLogout = () => {
    onLogout(); // Function to log out the user
    navigate('/login'); // Redirect to login page after logout
  };

  return (
    <header className="header">
      <div className="logo">Logo</div>
      <nav>
        {user ? (
          <>
            <button onClick={handleHomeClick} className="nav-button">Home</button>
            <button onClick={handleEmployeeListClick} className="nav-button">Employee List</button>
            <span className="user-info">
              {user.username} - <button onClick={handleLogout} className="logout-button">Logout</button>
            </span>
          </>
        ) : (
          <Link to="/signup" className="signup-button">Sign Up</Link>
        )}
      </nav>
    </header>
  );
};

export default Header;
